export default {
    name:"CourseStatistic",
    props:{
        courseStatistic:{
            type: Object,
            default: function(){
                return{
                    reveiwCnt:100,
                    content:"A+",
                    teaching:"A+",
                    grading:"A+",
                    workload:"A+",
                }
            }
        }
    },
    computed: {
        getRate(){
            return (grade) =>{
                switch(grade[0]){
                    case "A": return "rating-5";
                    case "B": return "rating-4";
                    case "C": return "rating-3";
                    case "D": return "rating-2";
                    case "F": return "rating-1";
                }
            }
        },

    }
}
